import React from 'react';
import BikeCard from './BikeCard';
import './bikeList.css'; // Link to updated styles

const BikeList = ({ bikes }) => {
  return (
    <div className="bike-list">
      {bikes.map((bike) => (
        <BikeCard key={bike.id} bike={bike} />
      ))}
    </div>
  );
};

export default BikeList;
